var b="url",c="04__تایید_و_ارسال_قرارداد_اعطای_نمایندگی_فروش-اشخا.html",d="generationDate",e=new Date(1755321963980.08),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="lg",s="vi",t="check",u="san",v="ba",w="loginv",x="inpa",y="page",z="packageId",A="c543c32127474dc4a3e4f75363f0dbfd",B="type",C="Axure:Page",D="04. تایید و ارسال قرارداد اعطای نمایندگی فروش-اشخاص حقیقی(واحد توسعه بازار)",E="notes",F="annotations",G="fn",H="1",I="ownerId",J="f0cbed4523b24eedbde5830d3a184eb4",K="label",L="(Text Field)",M="Note",N="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">کلیه فیلدهای دارای برچسب</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">&quot;</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#D9001B;\">Fetch</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">&quot;</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">قرار گرفته در باکس صورتی از فرم ایجاد قرارداد که پیش از این توسط کاربر واحد توسعه بازار مورد تایید قرار گرفته است واکشی و در فرم قرارداد جهت ثبت و ارسال به نماینده فروش به منظور تایید و امضای نماینده درج گردد</span></p>",O="2",P="59c9dca9c3894a62aebe66ed70fc5b24",Q="تایید و ارسال قراردا",R="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">در هنگام ثبت و ارسال قرارداد اعطای نمایندگی فروش جهت نماینده فروش؛ پیامکی مبنی بر اسال قرارداد با محتوای زیر،در&nbsp; خصوص افراد حقیقی به شماره موبایل فرد حقیقی، در خصوص افراد حقوقی به شماره موبایل تمامی صاحبان امضاء به صورت جداگانه و در خصوص مشارکت کننده مدنی به شماره موبایل تمامی مشارکت کنندگان مدنی ارسال گردد</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\"><br></span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">متن پیامک</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#A30014;\">جناب آقای/خانم ............. با شناسه نمایندگی ..........؛ قرارداد اعطای نمایندگی فروش شما ارسال گردید.خواهشمند است در اسرع وقت با مراجعه به سامانه فروش گیتی کالا نسبت به بررسی و تعیین وضعیت قرارداد خود اقدام نمایید</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#A30014;\">با تشکر، واحد فروش گیتی کالا</span></p>",S="3",T="323a4f83abae4fdf860b4238405ffecb",U="ghar",V="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">در صورتی که شرط چک در هنگام ایجاد قرارداد تیک زده شده باشد فیلدهای </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#FB0000;\">مبلغ </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">و </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#FB0000;\">تاریخ چک </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">به طور اتوماتیک واکشی و در صفحه 4 قرارداد درج گردد</span></p>",W="style",X="baseStyle",Y="627587b6038d43cca051c114ac41ad32",Z="pageAlignment",ba="center",bb="fill",bc="fillType",bd="solid",be="color",bf=0xFFFFFFFF,bg="image",bh="imageAlignment",bi="near",bj="imageRepeat",bk="auto",bl="favicon",bm="sketchFactor",bn="0",bo="colorStyle",bp="appliedColor",bq="fontName",br="Applied Font",bs="borderWidth",bt="borderVisibility",bu="borderFill",bv=0xFF797979,bw="cornerRadius",bx="cornerVisibility",by="outerShadow",bz="on",bA=false,bB="offsetX",bC=5,bD="offsetY",bE="blurRadius",bF="spread",bG="r",bH=0,bI="g",bJ="b",bK="a",bL=0.349019607843137,bM="adaptiveStyles",bN="interactionMap",bO="onLoad",bP="eventType",bQ="OnPageLoad",bR="description",bS="Page Loaded",bT="cases",bU="Case 1",bV="conditionString",bW="if value of loginv equals &quot;1&quot;",bX="isNewIfGroup",bY="caseColorHex",bZ="AB68FF",ca="condition",cb="exprType",cc="binaryOp",cd="op",ce="==",cf="leftExpr",cg="fcall",ch="functionName",ci="GetGlobalVariableValue",cj="arguments",ck="globalVariableLiteral",cl="variableName",cm="rightExpr",cn="stringLiteral",co